import { useState } from "react";
import Banner from "../../components/player/Banner";
import data from "../../data.json"

const players = data.pro["players"];


export default function Pro () {

    const [isCategori,setIsCategori] = useState('전체');


    return(
        <>
          <Banner onBannerTab={'프로'} aniWidth={'50%'}/>
          <section className="size1442 proArea">
            <div>
                <button onClick={() => setIsCategori('전체')} className={isCategori === '전체' ? 'active' : ''}>전체</button>
                {players.map((el,index) => <button className={isCategori === el.categori ? 'active' : ''} onClick={() => setIsCategori(el.categori)} key={index}>{el.categori}</button>)}
            </div>
            <ul>
                {players.map((el,index) => 
                <li key={index}>
                    <p>{el.title}</p>
                    <ul>
                        {el.profile.map((i,index)=>
                        <li key={i.id ? i.id : index}>
                            <img src={i.image} alt={i.name}/>
                            <button>프로필</button>
                        </li>
                        )}
                    </ul>
                </li>
                )}
            </ul>

          </section>
        </>

    )
}
